import React from 'react'
import styled from "styled-components"
import BlankPhone from "../images/about-phone.svg"

const Container = styled.div`
    width: 100%;
    height: 740px;
    background-color: #fff;
    font-family: 'Lato', sans-serif;
    color: #111439;
    padding-top: 20px;
`

const ContentContainer = styled.div`
    width: 1100px;
    height: 600px;
    padding-top: 30px;
    margin-left: 50%;
    transform: translateX(-50%);
    display: flex;
`

const TextContainer = styled.div`
    margin-top: 40px;
    margin-left: 50px;
    // background-color: #f00;
    width: 50%;
`

const AboutId = styled.h2`
    font-size: 14px;
    color: #CDCDE3;
    margin-bottom: 14px;
    font-weight: 700;
`

const AboutHeader = styled.h1`
    font-size: 32px;
    font-weight: 800;
`
const AboutIdDiv = styled.div`
    position: absolute;
    left: -1px;
    width: 2px;
    height: 14px;
    background-color: #CDCDE3;
`

const PhoneContainer = styled.div`
    width: 50%;
    margin-top: -30px;
    // background-color: #0f0;
`

const PhoneImg= styled.img`
    margin-left: 50px;
`


export default function AboutSection () {
    return (
        <Container>
            <ContentContainer>
            <TextContainer>
            <AboutIdDiv></AboutIdDiv>
            <AboutId>Who am I ?</AboutId>
            <AboutHeader>
                    A Little About Me ✌️
                </AboutHeader>
            </TextContainer>
            <PhoneContainer>
                    <PhoneImg src={BlankPhone}/>
                </PhoneContainer>
            </ContentContainer>
        </Container>
    )
}
